import './App.css';
import Button from "./Components/Buttons/Button.js";


function App() {
  return (
    <div className="App">
      <h1>Hiiiiiii</h1>
      <Button buttonStyle="btn--home">Home</Button>
      <Button buttonStyle="btn--home">About Me</Button>
      <Button >Projects</Button>
      <Button>Resume</Button>
    </div>
  );
}

export default App;
